function clearCookies(){
	document.cookie = "fromLoc=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
	document.cookie = "toLoc=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
	document.cookie = "depDate=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
	document.cookie = "retDate=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
	document.cookie = "AdultSel=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
	document.cookie = "ChildSel=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
	document.cookie = "InfantSel=; expires=Thu, 01 Jan 1970 00:00:00 UTC"; 
}

function saveCookie(){
  	fromLoc =$( "#fromLoc" ).val();
	toLoc =$( "#toLoc" ).val();
	depDate =$( "#depDate" ).val();
	retDate =$( "#retDate" ).val();
	AdultSel =$( "#AdultSel" ).val();
	ChildSel =$( "#ChildSel" ).val();
	InfantSel =$( "#InfantSel" ).val();
	if(fromLoc === "" || toLoc === "") {
		alert("missing from or to locations")
		} else if (depDate === "" || retDate === ""){
		alert("departure or return dates")
		} else{
		var d = new Date();
		d.setTime(d.getTime() + (365*24*60*60*1000)); // 1 year
		var expires = "expires="+ d.toUTCString();
		document.cookie = "fromLoc" + "=" + fromLoc + expires;
		document.cookie = "toLoc" + "=" + toLoc + expires;
		document.cookie = "depDate" + "=" + depDate + expires;
		document.cookie = "retDate" + "=" + retDate + expires;
		document.cookie = "AdultSel" + "=" + AdultSel + expires;
		document.cookie = "ChildSel" + "=" + ChildSel + expires;
		document.cookie = "InfantSel" + "=" + InfantSel + expires;
	}
}

function loadCookie(){
	if(document.cookie===""){alert("no saved searches")} else {
		var decodedCookie = decodeURIComponent(document.cookie);
		var ca = decodedCookie.replace(/expires.*?GMT;?/g, "").split(' ')
		for(var i=0; i<ca.length; i++){
			$('#' + ca[i].split('=')[0]).val(ca[i].split('=')[1])
		}
	}
}

